import { FunctionComponent } from "react";
import styles from "./FrameComponent.module.css";
import { useState } from 'react';


type FrameComponentType = {
  onClose?: () => void;
};

const FrameComponent: FunctionComponent<FrameComponentType> = ({ onClose }) => {
  const [counter, setCounter] = useState(0);

  const incrementCounter = () => {
    setCounter(prevCounter => prevCounter + 1);
  };

  const decrementCounter = () => {
    if (counter > 0) {
      setCounter(prevCounter => prevCounter - 1);
    }
  };

  return (
    <div className={styles.frameParent}>
      <div className={styles.frameGroup}>
        <div className={styles.parent}>
          <b className={styles.b}>{counter}</b>
          <img className={styles.frameChild} alt="" src="/frame-38.svg" />
        </div>
        <img className={styles.frameItem} alt="" src="/frame-37.svg" />
      </div>
      <button onClick={incrementCounter}>+</button>
      <button onClick={decrementCounter}>-</button>
    </div>
  );
};

export default FrameComponent;
